import React from "react";
import styled from "@emotion/styled";

const ProjectDetail = (props) => {
  const goals = props.goal.split(",");
  console.log(goals);
  return (
    <article>
      <meta itemProp="headline" content={props.title} />
      <p>{props.company}</p>
      <header>
        <h1>{props.title}</h1>
      </header>

      <p>{props.year}</p>
      <hr />
      <div>
        <h3>Summary</h3>
        <p>{props.summary}</p>
      </div>
      <div>
        <h3>Project goals</h3>
        <p>
          {goals[1]} <br />
          {goals[2]} <br />
          {goals[3]} <br />
          {goals[4]}
        </p>
      </div>
      <div>
        <h3>Roles</h3>
        {props.role}
      </div>
    </article>
  );
};

export default ProjectDetail;
